import {colors} from "../consts"
import classes from "../styles/TerminalForm.module.css"

export default function TerminalForm() {
  return (
    <div className={classes.window}>
      <div className={classes.frame}></div>
      <p>
        guest<em>$</em> <span style={colors.foam}>Your name:</span>&nbsp;
        <input />
      </p>
      <p>
        guest<em>$</em> <span style={colors.foam}>Your phone:</span>&nbsp;
        <input />
      </p>
      <p>
        guest<em>$</em> <span style={colors.foam}>Your email adress:</span>&nbsp;
        <input />
      </p>
      <p className={classes.line}>
        guest<em>$</em> <span style={colors.foam}>Your adress:</span>&nbsp;
        <input />
      </p>
    </div>
  )
}
